import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/"> //유저가 홈화면으로 갈 때 사용할 route</Route>
      </Switch>
    </Router>
  );
}

export default App;
